import React from 'react';


class History extends React.Component {
    constructor(){
        super();
        this.state = {
        }
      }

    // historyarr = () => {
    // fetch(`http://localhost:3000/history`, {
    //     method: 'POST',
    //     headers: {'Content-Type': 'application/json'},
    //     body: JSON.stringify({
    //         id: this.props.user.id
    //     })
    // })
    // .then(response => response.json())
    // .then(puncharray =>{
    //     this.setState({array: puncharray});
    // })
    // .catch(err => console.log(err));
    // }

    

    render() {
        
        const { historyarray } = this.props;
        console.log(historyarray);
        return(
            <div>
                {historyarray.map(function(data, i){
                    
                    return(
                        <div className='flex flex-wrap center list ba w-third' >
                        <li key={i} className={'fw6 f3 pa3 mr4'}> {data.location} </li>
                        <li key={i} className={'fw6 f3 pa3 mr4'}> {data.inout} </li>
                        <li key={i} className={'fw6 f3 pa3 mr4'}> {data.date} </li>
                        <li key={i} className={'fw6 f3 pa3 mr4'}> {data.time} </li>
                        </div>
                        )

                })}
            </div>
        )
    }
}


export default History;
